import './Privacy.css'

function Privacy() {
    const handlePricacyToggle = () => {
        const consentForm = document.querySelector('.consent-form-container');
        const consentButton = document.querySelector('.consent-button-toggler');

        if (consentForm.classList.contains('active')) {
            consentForm.classList.remove('active');
            consentButton.textContent = 'ยง';
        } else {
            consentForm.classList.add('active');
            consentButton.textContent = 'X';
        }

    }

    return (
        <>
            <button onChange={handlePricacyToggle} className='consent-button-toggler'>ยง</button>
            <div className='consent-form-container active'>

            </div>
        </>
    )
} 

export default Privacy;
